if SDTM.QS.QSORRES='N' then SDTM.QS.QSSTRESC='0',
else if SDTM.QS.QSORRES='Y' then SDTM.QS.QSSTRESC='1',
else if SDTM.QS.QSORRES='NA' then SDTM.QS.QSSTRESC='96';
If SDTM.QS.QSCAT='MODIFIED HACHINSKI ISCHEMIC SCORE' then: 
if SDTM.QS.QSORRES='ABSENT' then SDTM.QS.QSSTRESC='0',
else if SDTM.QS.QSORRES='PRESENT' and SDTM.QS.QSTESTCD in ('MHITM02','MHITM04','MHITM05','MHITM06','MHITM07','MHITM08','MHITM09','MHITM11')then SDTM.QS.QSSTRESC='1', 
else if SDTM.QS.QSORRES='PRESENT' and SDTM.QS.QSTESTCD in ('MHITM01','MHITM03','MHITM10','MHITM12','MHITM13') then SDTM.QS.QSSTRESC='2';
If SDTM.QS.QSTESTCD='CIBIC' then:
if SDTM.QS.QSORRES='MARKED IMPROVEMENT' then SDTM.QS.QSSTRESC='1',
else if SDTM.QS.QSORRES='MODERATE IMPROVEMENT' then SDTM.QS.QSSTRESC='2',
else if SDTM.QS.QSORRES='MINIMAL IMPROVEMENT' then SDTM.QS.QSSTRESC='3',
else if SDTM.QS.QSORRES='NO CHANGE' then SDTM.QS.QSSTRESC='4',
else if SDTM.QS.QSORRES='MINIMAL WORSENING' then SDTM.QS.QSSTRESC='5',
else if SDTM.QS.QSORRES='MODERATE WORSENING' then SDTM.QS.QSSTRESC='6',
else if SDTM.QS.QSORRES='MARKED WORSENING' then SDTM.QS.QSSTRESC='7';
If SDTM.QS.QSCAT=NEUROPSYCHIATRIC INVENTORY - REVISED (NPI-X) and SDTM.QS.QSTESTCD not equal to 'NPTOT' then:
if SDTM.QS.QSORRES='ABSENT' then SDTM.QS.QSSTRESC='0',
else if SDTM.QS.QSORRES='NOT APPLICABLE' then SDTM.QS.QSSTRESC='96',
else SDTM.QS.QSSTRESC=SDTM.QS.QSORRES;
If SDTM.QS.QSCAT=NEUROPSYCHIATRIC INVENTORY - REVISED (NPI-X) and SDTM.QS.QSTESTCD='NPTOT' then SDTM.QS.QSSTRESC is the first two numbers from SDTM.QS.QSSTRESN;
For all other parameters SDTM.QS.QSSTRESC=SDTM.QS.QSORRES;

